};

const parseCSV = (csvText) => {
  const lines = csvText.split("\n");
  const t = [];
  const tenz = []; // CH1 - тензометрический сигнал
  const interf = []; // CH3 - интерферометрический сигнал

  let dataStarted = false;
  let lineCount = 0;

  for (let i = 0; i < lines.length; i++) {
    const line = lines[i].trim();

    // Пропускаем пустые строки и заголовки
    if (!line) continue;

    // Ищем начало данных (строка с "TIME,CH1,...")
    if (line.startsWith("TIME,CH1,")) {
      dataStarted = true;
      continue;
    }

    // Если нашли начало данных, начинаем парсить
    if (dataStarted) {
      lineCount++;

      // Пропускаем начальные строки (6650-27000 как в оригинале)
      if (lineCount < 6650) continue;
      if (lineCount > 27000) break;

      const fields = line.split(",");

      if (fields.length >= 5) {
        const timeVal = parseFloat(fields[0]); // TIME
        const ch1Val = parseFloat(fields[1]); // CH1 - тензосигнал
        const ch3Val = parseFloat(fields[3]); // CH3 - интерферометр

        if (!isNaN(timeVal) && !isNaN(ch1Val) && !isNaN(ch3Val)) {
          t.push(timeVal);
          // Применяем коэффициенты как в оригинальном коде: *0.00132*1.25
          tenz.push(ch1Val * 0.00132 * 1.25);
          // Добавляем смещение как в оригинале: +0.04
          interf.push(ch3Val + 0.04);
        }
      }
    }
  }

  console.log(
    `Прочитано данных: t=${t.length}, tenz=${tenz.length}, interf=${interf.length}`
  );
  console.log("Первые значения:", {
    t: t.slice(0, 5),
    tenz: tenz.slice(0, 5),
    interf: interf.slice(0, 5),
  });

  // Поиск нулевых пересечений
  const { t0, y0 } = findZeroCrossings(t, interf);
  console.log(`Найдено нулевых пересечений: ${t0.length}`);

  // Фильтрация близких точек
  const { filteredT0, filteredY0 } = filterClosePoints(t0, y0, 100e-9);
  console.log(`После фильтрации: ${filteredT0.length}`);

  // Расчет производной
  const { u_interf, dudt_interf } = calculateDerivative(filteredT0);
  const intersectionPoints = findSignalIntersectionsAtZero(t, tenz, interf);

  return {
    t,
    tenz,
    interf,
    t0: filteredT0,
    y0: filteredY0,
    u_interf,
    dudt_interf,
    intersectionPoints,
  };
};

const findZeroCrossings = (t, interf) => {
  const t0 = [];
  const y0 = [];

  for (let i = 1; i < interf.length; i++) {
    const y1 = interf[i - 1];
    const y2 = interf[i];

    // Проверяем пересечение нуля
    if ((y1 <= 0 && y2 > 0) || (y1 >= 0 && y2 < 0)) {
      const x1 = t[i - 1];
      const x2 = t[i];

      // Линейная интерполяция для точного определения точки пересечения
      if (y2 !== y1) {
        const t_zero = x1 - (y1 * (x2 - x1)) / (y2 - y1);
        t0.push(t_zero);
        y0.push(0);
      }
    }
  }

  return { t0, y0 };
};

const filterClosePoints = (t0, y0, minDistance) => {
  if (t0.length <= 1) {
    return { filteredT0: t0, filteredY0: y0 };
  }

  let filteredT0 = [...t0];
  let filteredY0 = [...y0];

  // Многократная фильтрация (k < 10 как в оригинале)
  for (let k = 0; k < 10; k++) {
    const newT0 = [filteredT0[0]];
    const newY0 = [filteredY0[0]];

    for (let i = 1; i < filteredT0.length; i++) {
      if (filteredT0[i] - newT0[newT0.length - 1] >= minDistance) {
        newT0.push(filteredT0[i]);
        newY0.push(filteredY0[i]);
      }
    }

    // Если количество точек не изменилось, выходим
    if (newT0.length === filteredT0.length) break;

    filteredT0 = newT0;
    filteredY0 = newY0;
  }

  return { filteredT0, filteredY0 };
};

const calculateDerivative = (t0) => {
  const u_interf = [];
  const dudt_interf = [];

  for (let i = 0; i < t0.length; i++) {
    if (i === 0) {
      u_interf[i] = (0.63 / 4) * 1e-6;
      dudt_interf[i] = 0;
    } else {
      u_interf[i] = u_interf[i - 1] + (0.63 / 4) * 1e-6;
      const du_interf = u_interf[i] - u_interf[i - 1];
      const dt_interf = t0[i] - t0[i - 1];
      dudt_interf[i] = dt_interf !== 0 ? du_interf / dt_interf : 0;
    }
  }

  return { u_interf, dudt_interf };
};

const findSignalIntersectionsAtZero = (
  t,
  tenz,
  interf,
  yThreshold = 0.02
) => {
  const intersections = [];

  for (let i = 1; i < t.length; i++) {
    const diffPrev = tenz[i - 1] - interf[i - 1];
    const diffCurr = tenz[i] - interf[i];

    if ((diffPrev <= 0 && diffCurr > 0) || (diffPrev >= 0 && diffCurr < 0)) {
      const t1 = t[i - 1];
      const t2 = t[i];
      const diffDelta = diffCurr - diffPrev;

      if (diffDelta === 0) continue;

      const ratio = -diffPrev / diffDelta;
      const time = t1 + ratio * (t2 - t1);

      const tenzValue =
        tenz[i - 1] + ratio * (tenz[i] - tenz[i - 1]);
      const interfValue =
        interf[i - 1] + ratio * (interf[i] - interf[i - 1]);

      // среднее (они почти равны)
      const value = (tenzValue + interfValue) / 2;

      if (Math.abs(value) <= yThreshold) {
        intersections.push({ time, value });
      }
    }
  }

  return intersections;
};

